import React, { useState } from "react";
import { Link } from "react-router-dom";
import { Footer, Navbar } from "../navfoot/navbar";
import { Dashboard } from "./adminlist/dashboard";
export const Adminpage=()=>
{
    const [d1,sd1]=useState([])
    const [d2,sd2]=useState([])
    const [d3,sd3]=useState([])
    const [d4,sd4]=useState([])
    const [d5,sd5]=useState([])
    const Db=()=>
    {
        sd1("db")
    }
    const Um=()=>
    {
        sd2("um")
    }
    const Aum=()=>
    {
        sd3('aum')
    }
    const Pm=()=>
    {
        sd4('pm')
    }
    const Urm=()=>
    {
        sd5('urm')
    }
    const Close=async()=>
    {
        document.getElementById('sidebar').style.display="close";
    }
    const Open=async()=>
    {
        document
    }
    return(
        <>
        <Navbar/>
        <div className="home">
            <div className="adpage">
            <div className="drop">
                        <Link onClick={Open}>
                            <img src={"list.svg"} width={'35px'} alt="list"/>
                        </Link>
                    </div>
                <aside id="sidebar" style={{display:'none'}}>
                    <div className="dropbar">
                            <button onClick={Close}>Close &times;</button>
                            <Link className="asidebtn" onClick={Db}><b>Dashboard</b></Link>
                            <Link className="asidebtn" onClick={Um}><b>User Management</b></Link>
                            <Link className="asidebtn" onClick={Aum}><b>Admin User Management</b></Link>
                            <Link className="asidebtn" onClick={Pm}><b>Project Management</b></Link>
                            <Link className="asidebtn" onClick={Urm}><b>Unit Request Management</b></Link>
                    </div>
                </aside>
                <section>
                    <Dashboard/>
                    {/* {
                        d1 ==='db'?<Dashboard/>:<UserRegister/>&&
                        d2 ==='um'?<Adminlogin/>:<UserRegister/>
                    } */}
                </section>
            </div>
        </div>
        <Footer/>
        </>
    )
}
